import React from 'react'
import config from '../components/config/defaultblueprint.json'
import 'rsuite/dist/styles/rsuite-default.css';
import { Icon } from 'rsuite';
import {SocialIconVprops,CompanyInfoVprops} from '../GridV';



const SocialIcon2=()=>{
    const output=[];

    const myStyle={
        margin: "0px 15px"
    }

    const getSocialIcons=(item: {
    icon: string;
    url: string;
    color: string;
    target: string;
}[])=>{
      Array.isArray(config.companyInfo.socialicon) && config.companyInfo.socialicon.forEach((items)=>{
        output.push(<a href={items.url} target={items.target} style={{color:items.color }}>
             <Icon icon={items.icon} size="2x" style={myStyle} />
            </a>)
      })
      return output;
    }

    return(
        <div>
   {getSocialIcons()}
        </div>
    )
}

export default SocialIcon2;
